import React from "react";
import Dictionary from "./Dictionary";

function Footer() {
  return (
    <footer
      style={{
        marginTop: "40px",
        padding: "16px",
        backgroundColor: "#f3f0f9",
        color: "#4b3f72",
        textAlign: "center",
        fontSize: "0.9rem",
        borderTop: "1px solid #e0d7ec",
        fontFamily: "'Poppins', sans-serif",
      }}
    >
      <p>
        Developed by{" "}
        <a
          href="https://github.com/Tania-Figueiredo"
          target="_blank"
          rel="noopener noreferrer"
          style={{
            color: "#a85d9b",
            textDecoration: "none",
            fontWeight: "600",
          }}
        >
          Tania Figueiredo
        </a>
        . Open-sourced on{" "}
        <a
          href="https://github.com/Tania-Figueiredo/dictionary-react-project"
          target="_blank"
          rel="noopener noreferrer"
          style={{
            color: "#a85d9b",
            textDecoration: "none",
            fontWeight: "600",
          }}
        >
          GitHub
        </a>
        . Deployed on{" "}
        <a
          href="https://reactaddondictionary.netlify.app/"
          target="_blank"
          rel="noopener noreferrer"
          style={{
            color: "#a85d9b",
            textDecoration: "none",
            fontWeight: "600",
          }}
        >
          Netlify
        </a>
        .
      </p>
    </footer>
  );
}

export default function App() {
  return (
    <div className="App">
      <Dictionary />
      <Footer />
    </div>
  );
}
